const routes = [
    {
        path: "/home",
        component: 'Home',
        routes: [
            {
                path: "/home/news",
                component: 'News'
            },
            {
                path: "/home/stores",
                component: 'Stores'
            },
            {
                path: "/home/about",
                component: 'About'
            },
            {
                path: "/home/contact",
                component: 'Contact'
            }
        ]
    },
    {
        path: "/menu",
        component: 'Menu',
        routes: [
            {
                path: "/menu/pizza",
                component: 'Pizza'
            },
            {
                path: "/menu/drinks",
                component: 'Drinks'
            },
            {
                path: "/home/cake",
                component: 'Cake'
            }
        ]
    },
];
